def run():
    pi = PI()
    checks = {}
    for x, y in _zip(range(1000), pi):
        #print y,
        if x in tests:
            checks[x] = pi.a1
    if tests != checks:
        raise RuntimeError

def main():
    for i in range(1000):
        run()
    return True

